import React from 'react'
import {
    Link
  } from "react-router-dom";

const Home = () => {
  return (
    <>
    <h3>Home</h3>
    <Link to="chats/new">New Chat</Link>
    <button>Create a New Chat</button> <br /> <br />
    <button>Join a Chat</button>
    </>
  )
}

export default Home
